import React , { Component } from 'react';
import { DragDropContext } from 'react-beautiful-dnd';
import { Row, Container, Col, Image } from 'react-bootstrap';


export default class DndPizza extends Component {
    onDragEnd = result => {

    }
    render() {
        return(
            <>
                <DragDropContext onDragEnd={this.onDragEnd}>
                    <Col>
                    <Image src={require("../../images/pizza_crust.png")} rounded />
                    </Col>
                </DragDropContext>
                <DragDropContext>
                    <Col>
                    <Image src={require("../../images/mushroom.png")} rounded />
                    <Image src={require("../../images/pepperoni.png")} rounded />
                    </Col>
                </DragDropContext>
            </>
        )
    }
}
